import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Search, Filter, MapPin, Clock, ArrowLeft, X } from 'lucide-react';

const Events = ({ events, searchTerm, setSearchTerm }) => {
  const navigate = useNavigate();
  const [isSearchActive, setIsSearchActive] = useState(false);
  const [activeFilter, setActiveFilter] = useState('All');
  
  const categories = ['All', 'Tech', 'Cultural', 'Sports', 'Workshops'];

  // Filter logic
  const filteredList = events.filter(event => 
    (activeFilter === 'All' || event.category === activeFilter) &&
    event.title.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div style={styles.container}>
      {/* YouTube Style Header */}
      <header style={styles.header}>
        {!isSearchActive ? (
          <>
            <h2 style={{ fontSize: '22px', fontWeight: 'bold', margin: 0 }}>Events</h2>
            <div style={{ display: 'flex', gap: '15px' }}>
              <Search size={22} onClick={() => setIsSearchActive(true)} style={{ cursor: 'pointer' }} />
              <Filter size={22} style={{ cursor: 'pointer' }} />
            </div>
          </>
        ) : (
          <div style={styles.searchHeaderFull}>
            <ArrowLeft size={24} onClick={() => { setIsSearchActive(false); setSearchTerm(""); }} style={{ cursor: 'pointer' }} />
            <div style={styles.searchInputWrapper}>
              <input 
                autoFocus
                type="text" 
                placeholder="Search events..." 
                style={styles.fullInput} 
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
              />
              {searchTerm && <X size={20} style={styles.clearIcon} onClick={() => setSearchTerm("")} />}
            </div>
          </div>
        )}
      </header>

      {/* Category Filter Chips */}
      <div style={styles.filterRow}>
        {categories.map(cat => (
          <button 
            key={cat} 
            onClick={() => setActiveFilter(cat)}
            style={styles.filterChip(activeFilter === cat)}
          >
            {cat}
          </button>
        ))}
      </div>

      {/* Event List */}
      <div style={styles.scrollArea}>
        {filteredList.length > 0 ? (
          filteredList.map(event => (
            <div key={event.id} style={styles.card}>
              <img src={event.image} alt={event.title} style={styles.cardImage} />
              <div style={styles.cardBody}>
                <h4 style={styles.cardTitle}>{event.title}</h4>
                <div style={styles.detailRow}><Clock size={14} style={{marginRight: '8px'}} /><span>{event.date}</span></div>
                <div style={styles.detailRow}><MapPin size={14} style={{marginRight: '8px'}} /><span>{event.location}</span></div>
                <button style={styles.regBtn}>Register</button>
              </div>
            </div>
          ))
        ) : (
          <div style={styles.noResults}>No events related to "{searchTerm}" found.</div>
        )}
      </div>
    </div>
  );
};

const styles = {
  container: { maxWidth: '375px', margin: '0 auto', backgroundColor: '#fff', height: '100vh', display: 'flex', flexDirection: 'column', fontFamily: 'sans-serif' },
  header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '16px', borderBottom: '1px solid #f1f5f9', height: '60px' },
  searchHeaderFull: { display: 'flex', alignItems: 'center', width: '100%', gap: '10px' },
  searchInputWrapper: { position: 'relative', flex: 1 },
  fullInput: { width: '100%', padding: '10px 35px 10px 15px', borderRadius: '20px', border: 'none', backgroundColor: '#f1f5f9', outline: 'none' },
  clearIcon: { position: 'absolute', right: '10px', top: '50%', transform: 'translateY(-50%)', color: '#94a3b8' },
  filterRow: { display: 'flex', gap: '10px', overflowX: 'auto', padding: '12px 16px', scrollbarWidth: 'none' },
  filterChip: (isActive) => ({ padding: '8px 20px', borderRadius: '12px', border: 'none', backgroundColor: isActive ? '#e0e7ff' : '#f8fafc', color: isActive ? '#2563eb' : '#64748b', fontWeight: 'bold', cursor: 'pointer' }),
  scrollArea: { flex: 1, overflowY: 'auto', paddingBottom: '100px' },
  card: { margin: '0 16px 20px', borderRadius: '16px', border: '1px solid #f1f5f9', overflow: 'hidden' },
  cardImage: { width: '100%', height: '160px', objectFit: 'cover' },
  cardBody: { padding: '16px' },
  cardTitle: { margin: '0 0 10px 0', fontSize: '18px', fontWeight: 'bold' },
  detailRow: { display: 'flex', alignItems: 'center', fontSize: '13px', color: '#64748b', marginBottom: '8px' },
  regBtn: { width: '100%', padding: '12px', backgroundColor: '#5c5cfc', color: 'white', border: 'none', borderRadius: '10px', fontWeight: 'bold', cursor: 'pointer' },
  noResults: { textAlign: 'center', padding: '40px', color: '#94a3b8' }
};

export default Events;
